CREATE TABLE IF NOT EXISTS `spell_powers` (
	`ID` INT(11) UNSIGNED NOT NULL AUTO_INCREMENT,
	`SpellID` INT(11) NULL DEFAULT NULL,
	`OrderIndex` TINYINT(4) UNSIGNED NULL DEFAULT NULL,
	`ManaCost` INT(11) NULL DEFAULT NULL,
	`ManaCostPerLevel` INT(11) NULL DEFAULT NULL,
	`ManaPerSecond` INT(11) NULL DEFAULT NULL,
	`PowerDisplayID` INT(11) UNSIGNED NULL DEFAULT NULL,
	`AltPowerBarID` INT(11) NULL DEFAULT NULL,
	`PowerCostPct` FLOAT(12) NULL DEFAULT NULL,
	`PowerCostMaxPct` FLOAT(12) NULL DEFAULT NULL,
	`PowerPctPerSecond` FLOAT(12) NULL DEFAULT NULL,
	`PowerType` TINYINT(4) NULL DEFAULT NULL,
	`RequiredAuraSpellID` INT(11) NULL DEFAULT NULL,
	`OptionalCost` INT(11) UNSIGNED NULL DEFAULT NULL,
	PRIMARY KEY (`ID`, `SpellID`) USING BTREE
);

